        <p className="description">
          –ú—ã –∞–∫—Ç–∏–≤–Ω–æ —Ä–∞–±–æ—Ç–∞–µ–º –Ω–∞–¥ —ç—Ç–∏–º –ø—Ä–æ–¥—É–∫—Ç–æ–º. –°–ª–µ–¥–∏—Ç–µ –∑–∞ –æ–±–Ω–æ–≤–ª–µ–Ω–∏—è–º–∏, —á—Ç–æ–±—ã –ø–µ—Ä–≤—ã–º–∏ —É–∑–Ω–∞—Ç—å –æ –µ–≥–æ –≤—ã—Ö–æ–¥–µ!
        </p>
